import React, {useState} from "react";

class Notes extends React.Component {
    constructor() {
        this.state = {
            notes: [{title: "ok", content: "ok"}]
        };
        this.setNotes = this.setNotes.bind(this);
    }

    setNotes(notes) {
        this.setState({notes: notes});
    }
}

export default Notes;
